pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

// TODO - import Wallet (via an interface??)
import "./Wallet.sol";

contract Dex is Wallet {

    using SafeMath for uint256;

    enum Side {
        BUY,
        SELL
    }

    struct Order {
        uint id;
        address trader;
        Side side;
        bytes32 ticker;
        uint amount;
        uint price; 
    }
    // order.side = Side.BUY;

    mapping(bytes32 => mapping(uint => Order[])) public orderBook;    //Ticker => (Side => orders)

    uint nextOrderId = 1;

    function getOrderBook(bytes32 ticker, Side side) view public returns(Order[] memory) {
        return(orderBook[ticker][uint(side)]);
    }
    // Note: Call would be :
    //  getOrderBook(bytes32("LINK"), Side.BUY);

/*
    function createLimitOrder(bytes32 ticker, Side side, uint price, uint amount)
        external
        isKnownToken(ticker)
        returns(Order memory limitOrder) 
    {
    //     // TODO
        return limitOrder;
    }
*/

    function createLimitOrder(bytes32 ticker, Side side, uint price, uint amount)
        external
        returns(Order memory limitOrder) 
    {
        if (side == Side.BUY) {
            require(
                balances[msg.sender]["ETH"] >= amount.mul(price),
                "Not enough ETH on deposit!"
            );
        }
        else if (side == Side.SELL) {
            require(
                balances[msg.sender][ticker] >= amount,
                "Too few tokens for sell order!"
            );
        }

        Order[] storage orders = orderBook[ticker][uint(side)];
        orders.push(
            Order(nextOrderId, msg.sender, side, ticker, amount, price)
        );
        nextOrderId = nextOrderId.add(1);

        // Sort the orders on price (employing one-pass bubble sort).
        // Note: Only new order (last order in array due to push) needs sorting,
        // since all previous orders have already been sorted.
        if (side == Side.BUY) {
        // Buy-side order prices should be ordered highest -> lowest, e.g [10, 7, 5, 3]
            for (uint i=orders.length-1; i>0; i--) {
                if (orders[i].price > orders[i-1].price) { // needs sorting
                    // swap the two elements
                    Order memory higherPricedOrder = orders[i];
                    orders[i] = orders[i-1]; 
                    orders[i-1] = higherPricedOrder;
                } 
            }
        }
        else if (side == Side.SELL) {
        // Sell-side order prices should be ordered lowest -> highest, e.g [3, 5, 7, 10]
            for (uint i=orders.length-1; i>0; i--) { // Since we push each new order, sort from end of array
                if (orders[i].price < orders[i-1].price) { /// needs sorting
                    // swap the two elements
                    Order memory lowerPricedOrder = orders[i];
                    orders[i] = orders[i-1]; 
                    orders[i-1] = lowerPricedOrder;
                } 
            }
        }


    }


    function depositETH() public payable {
        balances[msg.sender]["ETH"] = balances[msg.sender]["ETH"].add(msg.value);
    }


    function getETHBalance() view public returns(uint ethBalance){

    }



}
